import React, { useState } from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import PhysioProfile from "../components/PhysioProfile";
import "../styles/PhysioDashboard.css"; // Estilo específico para esta página

const PhysioDashboard = () => {
  const [activeTab, setActiveTab] = useState("perfil"); // Por padrão abre no perfil

  return (
    <>
      <Header />
      <main className="dashboard-page">
        <nav className="dashboard-nav">
          <button
            className={activeTab === "perfil" ? "active" : ""}
            onClick={() => setActiveTab("perfil")}
          >
            Perfil do Utilizador
          </button>
          <button
            className={activeTab === "documentacao" ? "active" : ""}
            onClick={() => setActiveTab("documentacao")}
          >
            Documentação
          </button>
          <button
            className={activeTab === "tratamentos" ? "active" : ""}
            onClick={() => setActiveTab("tratamentos")}
          >
            Tratamentos
          </button>
          <button
            className={activeTab === "sessoes" ? "active" : ""}
            onClick={() => setActiveTab("sessoes")}
          >
            Sessões
          </button>
          <button
            className={activeTab === "honorarios" ? "active" : ""}
            onClick={() => setActiveTab("honorarios")}
          >
            Honorários
          </button>
          <button
            className={activeTab === "blog" ? "active" : ""}
            onClick={() => setActiveTab("blog")}
          >
            Blog
          </button>
          <button
            className={activeTab === "plano" ? "active" : ""}
            onClick={() => setActiveTab("plano")}
          >
            Plano de Contingência COVID-19
          </button>
        </nav>

        <section className="dashboard-content">
          {activeTab === "perfil" && <PhysioProfile />}
          {activeTab === "documentacao" && <p>Área de Documentação (a desenvolver)</p>}
          {activeTab === "tratamentos" && <p>Área de Tratamentos (a desenvolver)</p>}
          {activeTab === "sessoes" && <p>Área de Sessões (a desenvolver)</p>}
          {activeTab === "honorarios" && <p>Área de Honorários (a desenvolver)</p>}
          {activeTab === "blog" && <p>Blog (a desenvolver)</p>}
          {activeTab === "plano" && <p>Plano de Contingência COVID-19 (a desenvolver)</p>}
        </section>
      </main>
      <Footer />
    </>
  );
};

export default PhysioDashboard;
